import React, { useState } from 'react';
import { Feature } from 'react-mapbox-gl';
import { useDispatch, useSelector } from 'react-redux';

import { selectDataCorona } from '../../redux/data/data.selectors';
import { popupToggle } from '../../redux/popup/popup.actions';

// import { selectDataCorona } from '../../redux/data/data.selectors';

import { CircleContainer } from './circle.style';

const Circle = ({ country }) => {
	const { name, coordinates } = country;
	const dataCorona = useSelector(selectDataCorona);
	const dispatch = useDispatch();
	return dataCorona.map(({ name, coordinates }) => (
		<CircleContainer
			type='circle'
			paint={{
				'circle-color': 'red',
				'circle-radius': 10
			}}
		>
			<Feature
				onClick={() => dispatch(popupToggle())}
				coordinates={[coordinates[1], coordinates[0]]}
				properties={name}
			/>
		</CircleContainer>
	));
};

export default Circle;
